import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import Mainpage from './components/Mainpage';

function App() {
  return (

    <Router>

    <Routes>
    <Route path="/" element={<Mainpage ></Mainpage>} />
    <Route path="/products" element={<Mainpage ></Mainpage>} />

    <Route path="/detail/:artid" element={<Mainpage ></Mainpage>} />
    <Route path="/cart" element={<Mainpage ></Mainpage>} />


    </Routes>


    </Router>
  );
}

export default App;
